  - meetupcom:
      meta_description: 'Rozhodli jsme se, že zkusíme udělat první ONLINE Medvědárnu

        Přenos zde: https://zoom.us/j/96688476433 (bude propojeno na FB i youtube)


        Big Brother v IT - měřit nebo neměřit, toť otázka


        Existuje mnoho přístupů a témat o řízení IT týmu a jedním z nejvíce diskutovaných v těchto dnech, kdy je většina lidí z IT na home office, je to, zda můžete (nebo měli byste) měřit práci vývojového týmu. Je to vůbec možné změřit a získat nějaké
        spolehlivé výsledky? Je to fér? Pojďme se o tom pobavit a říct si, jaké jsou běžné případy, kde měření může skutečně pomoci identifikovat základní problémy.


        Hlavním přednášejícím bude náš hlavní medvěd Míra Fuksa - zakladatel Coding Bear a představujeme naše dva hosty online Medvědárny a jsou jimi David Šimůnek a Štěpán Kopřiva.


        David Šimůnek - Technology Project Manager IBM, autor vlastního webu, přinášejícího osvědčené postupy z oblasti projektového řízení, agilních metod, leadershipu a osobního rozvoje. Dříve působil jako IT Project Manager pro Mall.cz a jako PM Consultant
        v KPMG.


        Štěpán Kopřiva - CTO ve společnosti Blindspot Solutions, specializuje se na oblast umělé inteligence a strojového učení a má za sebou desítky úspěšně dodaných inovativních produktů. Dříve působil jako Java vývojář v Oraclu a také jako výzkumný
        pracovník na ČVUT.


        Určitě se připojte, protože to bude velmi zajímavá diskuze na trochu kontroverzní téma . Také bude možné po celou dobu vysílání pokládat dotazy, na které průběžně odpovíme. Vysílat budeme live tady na fb a bude záznam i na youtube. Věříme, že se
        nám i vám tento formát zalíbí a že v něm v budoucnu můžeme také pokračovat.'
      og_title: Online Medvědárna, Wed, May 6, 3:00 PM | Meetup
