  - meetupcom:
      meta_description: 'OpenAPI - dobrý přítel nejen backend vývojáře


        Na další medvědárnu jsme pro přednášení ukecali Vlastíka Hájka :)) Vlastík je náš dlouholetý medvědí kamarád a na medvědárny chodí často, takže jste ho zde určitě už potkali. Dokonce měl na loňské únorové medvědárně vtipnou část Výlet :)) Je to
        velmi šikovný java vývojář a zkušený teamleader, tak si přijďte poslechnout jeho přednášku. Povíte si něco o dokumentování api v OpenAPI formátu a o tom, kolik práce může ušetřit jeden “texťák”. Určitě si odnesete spoustu užitečných informací nebo
        v rámci diskuze můžete toto téma rozebrat podrobněji a předat si tak zkušenosti i s ostatními účastníky.


        Hlaste se prosím standardně zde: https://bit.ly/35e2fpa'
